import React from 'react';
import { FaUser, FaCalendarAlt } from 'react-icons/fa';
import './TreatmentProcess.css';

const TreatmentProcess = () => {
  const patientName = 'Đỗ Quang Lực';
  const appointmentDate = '28 Tháng 4, 2023';
  const treatingDoctor = 'Dr. Emily Nguyen';
  const service = 'Trám răng';
  const treatmentProcess = 'Quy trình điều trị:';
  const treatmentResult = 'Kết quả điều trị:';
  const notes = 'Ghi chú:';

  return (
    <div className="treatment-process">
      <h2 className="treatment-process__title">Xem quy trình điều trị</h2>
      <div className="treatment-process__info">
        <p><FaUser /> Bệnh Nhân: {patientName}</p>
        <p><FaCalendarAlt /> Ngày khám: {appointmentDate}</p>
        <p><FaUser /> Bác sĩ điều trị: {treatingDoctor}</p>
        <p><FaUser /> Dịch vụ: {service}</p>
      </div>
      <div className="treatment-process__details">
        <h3 className="treatment-process__subheading">{treatmentProcess}</h3>
        <p className="treatment-process__text">...</p>
        <h3 className="treatment-process__subheading">{treatmentResult}</h3>
        <p className="treatment-process__text">...</p>
        <h3 className="treatment-process__subheading">{notes}</h3>
        <p className="treatment-process__text">...</p>
      </div>
    </div>
  );
};

export default TreatmentProcess;
